import './App.css';
import { Routes, Route } from 'react-router-dom';
import Home from './components/Home/Home';
import Dashboard from './components/Dashboard/Dashboard';

function App() {
  return (
    <div className='App'>
      <Routes>
        <Route><Home/></Route>
        <Route><Dashboard/></Route>
        {/* <Route path='/dashboard' element={<Dashboard />} /> */}
      </Routes>
    </div>
  );
}

export default App;
